import { Typography } from '@mui/material';
import React from 'react';

const About = () => {
    return (
        <div>
            <Typography >About DineOut</Typography>
            <p >DineOut is a restaurant finder website that helps you discover and book restaurants near you. You can browse through a variety of cuisines, locations, ratings, and offers from different restaurants and make reservations online. DineOut also provides you with exciting discounts on food and drinks, complimentary dishes, and happy hours at your favourite restaurants. Whether you are looking for a buffet, a pocket-friendly meal, a pet-friendly place, or a family time spot, DineOut has something for everyone.</p>
        </div>
    );
};

export default About;
